        initialValues: {
            Mname: "",
            Mnumber: "",
            Memail: "",

        },
        onSubmit: (values) => {
            
        }
    })
    console.log(formik.values);
    return (
        <form>
            <div className="Mform_input">
                <input
                    id="Mname"
                    name="Mname"
                    type="text"
                    placeholder="Ваше имя"
                    onChange={formik.handleChange}
                    value={formik.values.Mname}
                />
            </div>
            <div className="Mform_input">
                <input
                    id="Mnumber"
                    name="Mnumber"
                    type="number"
                    placeholder="Телефон"
                    onChange={formik.handleChange}
                    value={formik.values.Mnumber}
                />
            </div>
            <div className="Mform_input">
                <input
                    id="Memail"
                    name="Memail"
                    type="email"
                    placeholder="E-mail"
                    onChange={formik.handleChange}
                    value={formik.values.Memail}
                />
            </div>
        </form>
    )
}
